   "source": [
    "> Activities with a light level of intensity make up most of the daily amount of active minutes. Using the correlation test results and the scatterplots, we may conclude that fairly active minutes have an almost negligible relationship with the number of calories burned daily. \n",
    ">\n",
    "> In addition, a higher proportion of time spent in light activity don't seem to translate into more calories burned, it's the opposite, with a moderate negative relationship. \n",
    ">\n",
    "> On the other hand, **the only significant positive correlation is the amount of very active minutes. The higher the proportion of this activity level in a day, the higher the calories burned.**"
   ]
  },
