   "source": [
    "1. negligible negative correlation between the number of steps you take a day and the amount of time you sleep\n",
    "\n",
    "2. the time spent in sedentary activity has a **moderate negative correlation with the amount of sleep** a user gets a day. On the other hand, we see a **very weak negative correlation** between the number of sedentary minutes and **the time taken to sleep**.\n",
    "\n",
    "3. **only the very active minutes seem to have a significant and strong relationship.** The other two present a very weak correlation. **the only significant positive correlation is the amount of very active minutes. The higher the proportion of this activity level in a day, the higher the calories burned.**\n",
    "\n",
    "4. **the intensity level of the activity has a very significant positive relationship with the number of calories burned per hour. When it comes to the number of steps taken per hour, we find again a strong positive correlation with the calories burned**\n",
    "\n",
    "5. Both groups of box plots reveal that **user activity peaks around 18 (6 p.m.)** with the highest average number of calories burned. Besides, it is interesting to point out that **around 13 (1 p.m.), user activity peaks again but with a slightly smaller intensity.**\n",
    "\n",
    "6. "
